import { useEffect, useState, useParams } from "react";
import data from '../data/data.json';

function Cases() {

  useEffect(() => {
      document.title = 'Cases';
  }, []);

  // get ID from json file
  const params = useParams();
  console.log(params); // üëâÔ∏è {userId: '4200'}

  return <h1>{params.id}</h1>

    return (
      <section class="section site-portfolio">
        <div class="container">
        <h2 className="cases-header">Cases</h2>
        {data.map(item => {
        return (
            <div id="portfolio-grid" className="mt-3" data-aos="fade-up" data-aos-delay="200">
            <div class="item web mb-4">
                <a href={`case-detail/${item.id}`} target="_blank" class="item-wrap fancybox">
                    <div class="work-info">
                    <h3>{item.name}</h3>
                    <span>{item.category}</span>
                    </div>
                    <img class="img-fluid" src={item.image} alt="" />
                </a>
            </div>
        </div>
            )
        })}
        </div>
      </section>
    );
}

export default Cases;
